import MainSection from '../../component/MainSection/MainSection';
import Slider from '../../component/Slider/Slider';


const Home = () => {
  const data = [];
  return (
    <div className='home'>
      <div className='row '>
        <div className='col'>
          <MainSection />
        </div>
        <div className='col'>
          <Slider data={data} />
        </div>
      </div>
    </div>
  );
};

export default Home;
